import { useState } from 'react';
import { TextField, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, MenuItem, Select, FormControl, InputLabel } from '@mui/material';

function App() {
    const [shopValue, setShopValue] = useState('');
    const [inventoryValue, setInventoryValue] = useState('');

    // Sample data for shops and inventory
    const shops = ["Shop 1", "Shop 2", "Shop 3"];
    const inventory = ["Inventory 1", "Inventory 2", "Inventory 3"];

    return (
        <div style={{ padding: '20px' }}>
            {/* Search Box for Shop */}
            <div style={{ marginBottom: '20px', maxWidth: '300px' }}>
                <FormControl fullWidth variant="outlined">
                    <InputLabel id="shop-select-label">Select Shop Here</InputLabel>
                    <Select
                        labelId="shop-select-label"
                        id="shop-select"
                        value={shopValue}
                        onChange={(e) => setShopValue(e.target.value)}
                        label="Select Shop Here"
                    >
                        {shops.map((shop, index) => (
                            <MenuItem key={index} value={shop}>{shop}</MenuItem>
                        ))}
                    </Select>
                </FormControl>
            </div>

            {/* Search Box for Inventory */}
            <div style={{ marginBottom: '20px', maxWidth: '300px' }}>
                <FormControl fullWidth variant="outlined">
                    <InputLabel id="inventory-select-label">Select Inventory Here</InputLabel>
                    <Select
                        labelId="inventory-select-label"
                        id="inventory-select"
                        value={inventoryValue}
                        onChange={(e) => setInventoryValue(e.target.value)}
                        label="Select Inventory Here"
                    >
                        {inventory.map((item, index) => (
                            <MenuItem key={index} value={item}>{item}</MenuItem>
                        ))}
                    </Select>
                </FormControl>
            </div>

            {/* Table */}
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Name</TableCell>
                            <TableCell>Age</TableCell>
                            <TableCell>Gender</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        <TableRow>
                            <TableCell>John Doe</TableCell>
                            <TableCell>30</TableCell>
                            <TableCell>Male</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Jane Smith</TableCell>
                            <TableCell>25</TableCell>
                            <TableCell>Female</TableCell>
                        </TableRow>
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
}

export default App;
